import React from 'react';
import style from './weather.module.css';

const Weather = ({city, country, description}) => {
    return(
        <div className={style.weather}>
            <h1>{city}'s Weather</h1>
            <h3>Current Weather: {description}</h3>
        </div>
    );
};

export default Weather;
